import { Item, ItemDate, ItemDetail, ItemImage, ItemInfo, ItemList, ItemName, Line, Tag } from './lostitem';

const Notice = () => {
  return (
    <ItemList>
      <Item>
        <ItemInfo>
          <ItemName>검정색 반지갑</ItemName>
          <ItemDetail>습득 장소 : 310관 1층</ItemDetail>
          <Line>
            <Tag>지갑/카드</Tag>
            <ItemDate>접수 일자 | 05.19</ItemDate>
          </Line>
        </ItemInfo>
      </Item>
    </ItemList>
  );
};
export default Notice;
